import React, {Component} from 'react';

import './Favourites.css';

class Favourites extends Component{
    constructor(props){
        super(props);
        this.state = {
            favourites: JSON.parse((localStorage.getItem('username'))).favourites,
        }
    }
    componentDidMount(){
    }
    
    render(){
        return(
            <div id='PopularTab'>
                {this.state.favourites.length === 0 ? <p id='nullMoviesTitle'>Hmmmm... Seems There are no movies here currently</p> : <p>Movies, an illusion</p>}
            </div>
        )
    }
}

export default Favourites;
